/* eslint-disable jsx-a11y/anchor-is-valid */
import { useEffect, useState } from "react";
import Product from "./Product";

function ProductsList(){
    const [ProductsList, setProductsList] = useState([]);
    useEffect(() => {
        const fetchData = async () => {
            const resp = await fetch("https://jsonplaceholder.typicode.com/photos?_start=0&_limit=21");
            if(!resp.ok) return;
            const data = await resp.json();
            setProductsList(data);
        }
        fetchData();

    });
    return (
        <>
        <div>
        <h4>Found: <span className="exclude">{ProductsList.length} results</span></h4>
        <div>
            <div>
                <ul>
                    <li>
                    <a >Colour <i className="arrow-down"></i></a>
                    </li>
                    <li>
                    <a >Brand <i className="arrow-down"></i></a>
                    </li>
                    <li>
                    <a>Design Style <i className="arrow-down"></i></a>
                    </li>
                </ul>
            </div>
        </div>

        </div>

        <h4>Found: <span className="exclude">{ProductsList.length} results</span></h4>
        <div className="all-products">
            {ProductsList.map((product) => (
                <Product
                key = {product.id}
                title = {product.title}
                url = {product.url}
                />
            ))}
        </div>
        </>
    )
}

export default ProductsList;
